// import { SET_PROFILE } from "./profileTypes";
export const SET_PROFILE = "SET_PROFILE";
export const SET_CURRENT_GAME = "SET_CURRENT_GAME";
export const SET_OVERALL_PROGRESS = "SET_OVERALL_PROGRESS";

export const setProfile = profile => {
	return { type: SET_PROFILE, payload: profile };
};

export const setCurrentGame = currentGameSetting => {
	return { type: SET_CURRENT_GAME, payload: currentGameSetting };
};

export const setOverallProgress = updatedProgress => {
	return { type: SET_OVERALL_PROGRESS, payload: updatedProgress };
};
